import { withAuth } from '../HOC/withAuth';
import { useContext, useState } from 'react';


function Timer() {

    const [inputTime, setInputTime] = useState('');
    let newTime = {
        Time: inputTime
        };
  return (
    <div >
      <main>
        <p align="center">
            <input
            placeholder="Enter time"
            value={inputTime} 
            title="Time"
            onChange={(event) => setInputTime(event.target.value)} 
            />
            <button onClick={redirect("")}>
                Go
            </button>

        </p>
      </main>
    </div>
  )
}

